import React from "react";
import { Menu, Icon } from "antd";

const AppLayout = () => {
return (
    <div>
        <Menu>
            <Menu.Item key="home">
                <Icon type="mail" />
                Navigation One
            </Menu.Item>
        </Menu>
    </div>
)
}
export default AppLayout;
